const Cart = () => {
    const { cartItems } = useSelector(state => state.cart);

    return (
        <>
        {
            cartItems ?
            <Grid container>
                <Grid item lg={9} md={9} sm={12}>

                </Grid>
                <Grid item>

                </Grid>
            </Grid>
            : <div>Empty</div>
        }
        </>
    )
}
export default Cart;
